/*
@title: Hue Havoc
@description: Hue Havoc is a multiplayer game where two players compete to cover the most area on a canvas with their color of paint. Both players have 20 seconds to navigate the canvas using specific controls (WASD and IJKL) in an attempt to outpaint each other. The aim is to claim as much territory as possible before the time runs out.
@author: Gus Ruben
@tags: ['multiplayer']
@addedOn: 2024-09-01
*/

// settings
const fps = 10;
const resolution = 4; // number of pixels in a tile (16 real pixels)

async function spiralAnimation(spriteChar, delay) {
	let top = 0,
		bottom = 7,
		left = 0,
		right = 9,
		direction = 0;

	while (top <= bottom && left <= right) {
		switch (direction) {
			case 0: // right
				for (let i = left; i <= right; i++) {
					clearTile(i, top);
					addSprite(i, top, spriteChar);
					await new Promise((res) => setTimeout(res, delay));
				}
				top++;
				break;
			case 1: // down
				for (let i = top; i <= bottom; i++) {
					clearTile(right, i);
					addSprite(right, i, spriteChar);
					await new Promise((res) => setTimeout(res, delay));
				}
				right--;
				break;
			case 2: // left
				for (let i = right; i >= left; i--) {
					clearTile(i, bottom);
					addSprite(i, bottom, spriteChar);
					await new Promise((res) => setTimeout(res, delay));
				}
				bottom--;
				break;
			case 3: // up
				for (let i = bottom; i >= top; i--) {
					clearTile(left, i);
					addSprite(left, i, spriteChar);
					await new Promise((res) => setTimeout(res, delay));
				}
				left++;
				break;
		}
		direction = (direction + 1) % 4;
		// wait <delay> seconds
	}
}

let currentLegendChar = 32; // start at the first real character (space)
function getLegendChar() {
	const char = String.fromCharCode(currentLegendChar++);
	if (char == "." || char == "\n" || char == " ") {
		// skip reserved characters
		return String.fromCharCode(currentLegendChar++);
	}
	return char;
}

// the title screen image needs to be split into 16x16 chunks
function splitBitmap(bitmap) {
	const rows = bitmap.trim().split("\n");
	const chunks = [];
	const chunkRows = rows.length / 16;
	const chunkCols = rows[0].length / 16;

	for (let i = 0; i < chunkRows; i++) {
		for (let j = 0; j < chunkCols; j++) {
			let chunk = [];
			for (let r = 0; r < 16; r++) {
				const rowIndex = i * 16 + r;
				const startCol = j * 16;
				const endCol = startCol + 16;

				chunk.push(rows[rowIndex].slice(startCol, endCol));
			}
			chunks.push(chunk.join("\n"));
		}
	}

	return chunks;
}

