function renderPlayer(player) {
	// const offsetX = (player.x % resolution) * (16/resolution);
	// const offsetY = (player.y % resolution) * (16/resolution);
	const offsetX = 0;
	const offsetY = 0;
	// console.log(player.y, offsetY)

	// player.direction == "up" && console.log(player.y, (player.y % (16/resolution)))

	const bitmaps = offsetBitmap(player[player.direction], offsetX, offsetY);
	setLegend(...player.legendChars.map((char, i) => [char, bitmaps[i]]));
}

function getPlayerPositionData(player) {
	const tileX = Math.floor(player.x / resolution);
	const tileY = Math.floor(player.y / resolution);

	// spaghetti code, returns each tile the player is occupying combined with the legend char for that bitmap
	return [
		[tileX, tileY],
		[tileX + 1, tileY],
		[tileX, tileY + 1],
		[tileX + 1, tileY + 1],
	].map((pos, i) => [pos, player.legendChars[i]]);
}

// offset a bitmap by a pixel amount, by creating 4 bitmaps and shifting the original bitmap across them
function offsetBitmap(bitmap, x, y) {
	// add padding on the top
	bitmap = "................\n".repeat(y) + bitmap.trim();
	// add padding on the bottom to make it 32 tall
	bitmap = bitmap + "\n................".repeat(16 - y);
	// add padding on the left and the right
	const rows = bitmap.split("\n");
	const paddingLeft = ".".repeat(x);
	const paddingRight = ".".repeat(16 - x);
	bitmap = rows.map((row) => paddingLeft + row + paddingRight).join("\n");

	// return bitmap;
	return splitBitmap(bitmap);
}

